import { Listaveicolidisponibili } from "../../actions/veicoliActions";
import React, { Component } from "react";

import PropTypes from "prop-types";
import { connect } from "react-redux";
import { Link, withRouter } from "react-router-dom";

//componenti da react-bootstrap
import { Container, Col, Row, Modal, Button } from "react-bootstrap";

import "../../App.css";
import classnames from "classnames";
import Mappa from "../googlemap/mappa";

import filtriVeicoli from "../../utils/filtriVeicoli";

class ListaVeicoli extends Component {
  state = {
    tipo: "",
    modello: "",
    marca: "",
    cilindrata: 0,
    n_posti: 0,
    n_porte: 0,
    targa: "",
    id_parcheggio: "",
    descrizione: "",
    prezzo_festivo: "",
    prezzo_feriale: "",
    stato: "",
    errors: {},
    filtroTipo: "",
    filtroParcheggio: "",
    filtroID: "",
    current_id: "",
    veicoli_inparcheggio: [], //per fare capienza mettere dentro tutti i veicoli del parcheggio selezionato e in caso restituire error
  };

  async componentDidMount() {
    const Veicolo = {
      tipo: localStorage.getItem("tipoVeicolo"),
    };
    await this.props.Listaveicolidisponibili(
      localStorage.getItem("tipoVeicolo"),
      Veicolo
    );
  }
  componentWillReceiveProps(nextProps) {
    if (nextProps.errors) {
      this.setState({
        errors: nextProps.errors,
      });
    }
  }

  onChange = async (e) => {
    await this.setState({ [e.target.id]: e.target.value });
  };

  onSubmit = (e) => {
    e.preventDefault();
  };

  render() {
    const { filtroTipo, filtroParcheggio, filtroID, errors } = this.state;
    let veicoliFiltrati = [];
    const { veicolo } = this.props.listaveicolidisponibili;
    veicoliFiltrati = filtriVeicoli(veicolo, filtroTipo, "tipo");
    veicoliFiltrati = filtriVeicoli(veicoliFiltrati, filtroID, "_id");

    const VL = (
      <Container sm={12} style={{ marginBottom: "21rem" }}>
        <div class="center" style={{ textAlign: "left" }}>
          <table class="responsive-table">
            <thead>
              <tr>
                <th>Modello</th>
                <th>Marca</th>
                <th>Cilindrata</th>
                <th>Numero posti</th>
                <th>Numero porte</th>
                <th>Prezzo Feriale</th>
                <th>Descrizione</th>
                <th>Seleziona</th>
              </tr>
            </thead>
            <tbody>
              {veicoliFiltrati.map((veicolo) => (
                <tr key={veicolo._id}>
                  <td>{veicolo.modello}</td>
                  <td>{veicolo.marca}</td>
                  <td>{veicolo.cilindrata}</td>
                  <td>{veicolo.n_posti}</td>
                  <td>{veicolo.n_porte}</td>
                  <td>{veicolo.prezzo_feriale}</td>
                  <td>{veicolo.descrizione}</td>
                  <td>
                    {" "}
                    <button
                      class="btn btn-primary btn-lg btn-block bottone"
                      onClick={() => this.deleteVeicolo(veicolo._id)}
                    >
                      Avanti
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </Container>
    );
    switch (stile) {
      case "Sì":
        return (
          <Container fluid style={{ marginBottom: "3rem" }}>
            <Row className="justify-content-md-center">
              <Mappa />
            </Row>
            <Container sm={12}>
              <h1
                style={{
                  color: "#010101",
                  fontWeight: "bold",
                  fontSize: "25px",
                  textAlign: "center",
                }}
              >
                VEICOLI DISPONIBILI
              </h1>
              {veicolo.length === 0
                ? "Non ci sono veicoli per la tipologia scelta disponibili"
                : VL}
            </Container>
          </Container>
        );
    }
  }
}

ListaVeicoli.propTypes = {
  Listaveicolidisponibili: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  errors: PropTypes.object.isRequired,
  listaveicolidisponibili: PropTypes.object.isRequired,
};
const mapStateToProps = (state) => ({
  auth: state.auth,
  errors: state.errors,
  listaveicolidisponibili: state.listaveicolidisponibili,
});
export default connect(mapStateToProps, {
  Listaveicolidisponibili,
})(ListaVeicoli);
